(function(){
'use strict';

// ═══════════════════════════════════════════════
// CLICK SOUND (embedded MP3)
// ═══════════════════════════════════════════════
var CLICK_B64='';

// ═══════════════════════════════════════════════
// MUSICAL CONSTANTS
// A minor — warm, not dark. Slow tempo for legato strings.
// 24 bars total, 8 bars per phase, ~100 seconds
// ═══════════════════════════════════════════════
var WIND_B64='';

var BPM = 55;
var BEAT = 60 / BPM;
var BAR = BEAT * 4;
var E8 = BEAT / 2;
var S16 = BEAT / 4;
var PHASE_BARS = 8;
var LOOP = BAR * PHASE_BARS * 3; // 24 bars

// Notes
var N = {
  A1:55, C2:65.41, D2:73.42, E2:82.41, F2:87.31, G2:98,
  A2:110, B2:123.47, C3:130.81, D3:146.83, E3:164.81, F3:174.61, G3:196,
  A3:220, B3:246.94, C4:261.63, D4:293.66, E4:329.63, F4:349.23, G4:392,
  A4:440, B4:493.88, C5:523.25, D5:587.33, E5:659.25
};

// Chord progression — Am but warm
// Using Am, C, F, G, Dm, Em — avoiding anything too dark
// Each chord lasts 2 bars (slow, legato changes)
// 4 chords per phase × 3 phases = 12 chord slots across 24 bars
var PROG = [
  // Phase 1: Gentle, open
  {ch:[N.A2, N.E3, N.A3, N.C4],       nm:'Am'},    // bars 1-2
  {ch:[N.C3, N.G3, N.C4, N.E4],       nm:'C'},     // bars 3-4
  {ch:[N.F2, N.C3, N.F3, N.A3],       nm:'F'},     // bars 5-6
  {ch:[N.G2, N.D3, N.G3, N.B3],       nm:'G'},     // bars 7-8

  // Phase 2: Same chords, scales added
  {ch:[N.A2, N.E3, N.A3, N.C4],       nm:'Am2'},   // bars 9-10
  {ch:[N.E2, N.B2, N.E3, N.G3],       nm:'Em'},    // bars 11-12
  {ch:[N.F2, N.C3, N.F3, N.A3],       nm:'F2'},    // bars 13-14
  {ch:[N.G2, N.D3, N.G3, N.B3],       nm:'G2'},    // bars 15-16

  // Phase 3: Swell — fuller, higher
  {ch:[N.A2, N.E3, N.A3, N.C4, N.E4], nm:'AmS'},   // bars 17-18
  {ch:[N.C3, N.G3, N.C4, N.E4, N.G4], nm:'CS'},    // bars 19-20
  {ch:[N.D3, N.A3, N.D4, N.F4],       nm:'DmS'},   // bars 21-22
  {ch:[N.E2, N.B2, N.E3, N.G3, N.B3], nm:'EmS'},   // bars 23-24
];

// Scale patterns per chord (16 notes: up then down, matching chord tones + passing)
var SC = {
  'Am2': [N.A3,N.B3,N.C4,N.D4,N.E4,N.F4,N.E4,N.D4,N.C4,N.B3,N.A3,N.B3,N.C4,N.D4,N.E4,N.D4],
  'Em':  [N.E3,N.F3,N.G3,N.A3,N.B3,N.C4,N.B3,N.A3,N.G3,N.F3,N.E3,N.F3,N.G3,N.A3,N.B3,N.A3],
  'F2':  [N.F3,N.G3,N.A3,N.B3,N.C4,N.D4,N.C4,N.B3,N.A3,N.G3,N.F3,N.G3,N.A3,N.B3,N.C4,N.B3],
  'G2':  [N.G3,N.A3,N.B3,N.C4,N.D4,N.E4,N.D4,N.C4,N.B3,N.A3,N.G3,N.A3,N.B3,N.C4,N.D4,N.C4],
  // Phase 3 scales (higher register)
  'AmS': [N.A3,N.B3,N.C4,N.D4,N.E4,N.F4,N.G4,N.F4,N.E4,N.D4,N.C4,N.B3,N.A3,N.C4,N.E4,N.A4],
  'CS':  [N.C4,N.D4,N.E4,N.F4,N.G4,N.A4,N.G4,N.F4,N.E4,N.D4,N.C4,N.D4,N.E4,N.G4,N.A4,N.G4],
  'DmS': [N.D4,N.E4,N.F4,N.G4,N.A4,N.B4,N.A4,N.G4,N.F4,N.E4,N.D4,N.E4,N.F4,N.G4,N.A4,N.G4],
  'EmS': [N.E4,N.F4,N.G4,N.A4,N.B4,N.C5,N.B4,N.A4,N.G4,N.F4,N.E4,N.F4,N.G4,N.A4,N.B4,N.A4],
};

// ═══════════════════════════════════════════════
// AUDIO ENGINE
// ═══════════════════════════════════════════════
var x = null, on = false, mg = null, tg = null, si = null, nlt = 0;
var cBuf = null, cOut = null, rvG = null, rvN = null;

function ai() {
  if (x) return;
  x = new (window.AudioContext || window.webkitAudioContext)();
  mg = x.createGain(); mg.gain.value = 0;
  var c = x.createDynamicsCompressor();
  c.threshold.value = -18; c.knee.value = 12; c.ratio.value = 3;
  c.attack.value = 0.01; c.release.value = 0.3;
  mg.connect(c); c.connect(x.destination);
  cOut = x.createGain(); cOut.gain.value = 1; cOut.connect(x.destination);

  // Reverb — longer, warmer for strings
  var rl = x.sampleRate * 4, rb = x.createBuffer(2, rl, x.sampleRate);
  for (var ch = 0; ch < 2; ch++) {
    var d = rb.getChannelData(ch);
    for (var i = 0; i < rl; i++) d[i] = (Math.random() * 2 - 1) * Math.pow(1 - i / rl, 1.8);
  }
  rvN = x.createConvolver(); rvN.buffer = rb;
  rvG = x.createGain(); rvG.gain.value = 0.35;
  rvG.connect(rvN); rvN.connect(mg);

  // Decode click
  var bin = atob(CLICK_B64), bytes = new Uint8Array(bin.length);
  for (var i = 0; i < bin.length; i++) bytes[i] = bin.charCodeAt(i);
  x.decodeAudioData(bytes.buffer, function(b) { cBuf = b; });
}

function ck() {
  if (!x) { ai(); }
  if (x.state === 'suspended') x.resume();
  if (!cBuf) return;
  try {
    var s = x.createBufferSource(); s.buffer = cBuf;
    var g = x.createGain(); g.gain.value = 0.35;
    s.connect(g); g.connect(cOut); s.start(0);
  } catch(e) {}
}

// ─── STRING PAD (warm, legato, like reference) ───
// Multiple detuned sawtooths, heavily filtered, slow attack/release
function str(freq, t, dur, vol) {
  var v = vol || 0.04;
  var att = Math.min(2.5, dur * 0.25);  // very slow attack
  var rel = Math.min(2.5, dur * 0.25);  // very slow release
  var detunes = [-12, -5, 0, 5, 12];    // 5 voices for lush width

  for (var di = 0; di < detunes.length; di++) {
    var o = x.createOscillator();
    o.type = 'sawtooth';
    o.frequency.value = freq;
    o.detune.value = detunes[di] + (Math.random() * 3 - 1.5);

    var fl = x.createBiquadFilter();
    fl.type = 'lowpass';
    fl.frequency.value = 400 + (vol > 0.06 ? 200 : 0);  // keep it very warm
    fl.Q.value = 0.3;

    var g = x.createGain();
    g.gain.setValueAtTime(0, t);
    g.gain.linearRampToValueAtTime(v / detunes.length, t + att);
    g.gain.setValueAtTime(v / detunes.length, t + dur - rel);
    g.gain.linearRampToValueAtTime(0, t + dur);

    o.connect(fl); fl.connect(g);
    g.connect(mg); g.connect(rvG);
    o.start(t); o.stop(t + dur + 0.2);
  }
}

// ─── SCALE NOTE (softer triangle, piano-like but warm) ───
function scN(freq, t, vol) {
  var v = vol || 0.03;
  // Long string tone — overlaps with next note for legato merge
  var dur = BEAT * 1.2;  // longer than a 16th so notes overlap
  var o = x.createOscillator();
  o.type = 'sawtooth';
  o.frequency.value = freq;
  o.detune.value = (Math.random() * 6 - 3);

  var o2 = x.createOscillator();
  o2.type = 'sawtooth';
  o2.frequency.value = freq;
  o2.detune.value = -5 + (Math.random() * 3);

  var fl = x.createBiquadFilter();
  fl.type = 'lowpass';
  fl.frequency.value = 600;
  fl.Q.value = 0.4;

  var g = x.createGain();
  g.gain.setValueAtTime(0, t);
  g.gain.linearRampToValueAtTime(v, t + 0.15);
  g.gain.setValueAtTime(v * 0.85, t + dur - 0.2);
  g.gain.linearRampToValueAtTime(0, t + dur);

  o.connect(fl); o2.connect(fl);
  fl.connect(g);
  g.connect(mg); g.connect(rvG);
  o.start(t); o.stop(t + dur + 0.1);
  o2.start(t); o2.stop(t + dur + 0.1);
}

// ─── DEEP KICK (bass-heavy, cinematic) ───
function ki(t, deep) {
  // Very low, sub-bass focused kick
  var o = x.createOscillator(); o.type = 'sine';
  o.frequency.setValueAtTime(deep ? 80 : 65, t);
  o.frequency.exponentialRampToValueAtTime(22, t + 0.3);
  var g = x.createGain();
  g.gain.setValueAtTime(deep ? 0.35 : 0.28, t);
  g.gain.exponentialRampToValueAtTime(0.001, t + 0.6);
  o.connect(g); g.connect(mg);
  o.start(t); o.stop(t + 0.7);
  // Subtle thud transient (not clicky)
  var o2 = x.createOscillator(); o2.type = 'sine';
  o2.frequency.setValueAtTime(120, t);
  o2.frequency.exponentialRampToValueAtTime(40, t + 0.05);
  var g2 = x.createGain();
  g2.gain.setValueAtTime(0.12, t);
  g2.gain.exponentialRampToValueAtTime(0.001, t + 0.08);
  o2.connect(g2); g2.connect(mg);
  o2.start(t); o2.stop(t + 0.15);
}

// ─── HI-HAT (soft, breathy) ───
function ht(t, op) {
  var bl = x.sampleRate * (op ? 0.1 : 0.018);
  var bf = x.createBuffer(1, bl, x.sampleRate), bd = bf.getChannelData(0);
  for (var i = 0; i < bl; i++) bd[i] = (Math.random()*2-1) * Math.pow(1-i/bl, op ? 2 : 6);
  var s = x.createBufferSource(); s.buffer = bf;
  var fl = x.createBiquadFilter(); fl.type = 'highpass'; fl.frequency.value = 7500;
  var g = x.createGain();
  g.gain.setValueAtTime(op ? 0.04 : 0.025, t);
  g.gain.exponentialRampToValueAtTime(0.001, t + (op ? 0.12 : 0.035));
  s.connect(fl); fl.connect(g); g.connect(mg); s.start(t);
}

// ─── SNARE (soft, brushed feel) ───
function sn(t) {
  var bl = x.sampleRate * 0.05;
  var bf = x.createBuffer(1, bl, x.sampleRate), bd = bf.getChannelData(0);
  for (var i = 0; i < bl; i++) bd[i] = (Math.random()*2-1) * Math.pow(1-i/bl, 3);
  var s = x.createBufferSource(); s.buffer = bf;
  var fl = x.createBiquadFilter(); fl.type = 'bandpass'; fl.frequency.value = 2800; fl.Q.value = 0.8;
  var g = x.createGain();
  g.gain.setValueAtTime(0.045, t);
  g.gain.exponentialRampToValueAtTime(0.001, t + 0.12);
  s.connect(fl); fl.connect(g); g.connect(mg); s.start(t);
}


// ═══════════════════════════════════════════════
// NATURE SOUNDS — wind, birds, stream
// Runs independently as continuous ambient layer
// ═══════════════════════════════════════════════
var natNodes = [];

function startNature() {
  // ── WIND: your reference MP3, gapless double-buffered loop ──
  var wBin = atob(WIND_B64), wBytes = new Uint8Array(wBin.length);
  for (var i = 0; i < wBin.length; i++) wBytes[i] = wBin.charCodeAt(i);
  x.decodeAudioData(wBytes.buffer.slice(0), function(wBuf) {
    // Double-buffer: two sources staggered so one is always playing
    // This eliminates the MP3 decoder gap at loop boundaries
    var wGain = x.createGain(); wGain.gain.value = 0.04;
    wGain.connect(mg);
    var dur = wBuf.duration;
    var xf = 2; // crossfade overlap in seconds
    function startLoop(startTime) {
      var src = x.createBufferSource();
      src.buffer = wBuf;
      var env = x.createGain();
      env.gain.setValueAtTime(0, startTime);
      env.gain.linearRampToValueAtTime(1, startTime + xf);
      env.gain.setValueAtTime(1, startTime + dur - xf);
      env.gain.linearRampToValueAtTime(0, startTime + dur);
      src.connect(env); env.connect(wGain);
      src.start(startTime);
      src.stop(startTime + dur + 0.1);
      natNodes.push(src);
      // Schedule next copy overlapping by xf seconds
      var next = startTime + dur - xf;
      if (next - x.currentTime < 120) { // keep scheduling for ~2 minutes ahead
        setTimeout(function() { if (on) startLoop(next); }, Math.max(0, (next - x.currentTime - 5) * 1000));
      }
    }
    startLoop(x.currentTime);
  });

  /* ── STREAM (commented out) ──
  var stLen = x.sampleRate * 3;
  var stBuf = x.createBuffer(2, stLen, x.sampleRate);
  for (var ch = 0; ch < 2; ch++) {
    var d = stBuf.getChannelData(ch);
    for (var i = 0; i < stLen; i++) d[i] = (Math.random() * 2 - 1);
  }
  var stSrc = x.createBufferSource();
  stSrc.buffer = stBuf; stSrc.loop = true;
  var stFilt = x.createBiquadFilter();
  stFilt.type = 'bandpass'; stFilt.frequency.value = 2500; stFilt.Q.value = 0.5;
  var stFilt2 = x.createBiquadFilter();
  stFilt2.type = 'lowpass'; stFilt2.frequency.value = 4000; stFilt2.Q.value = 0.3;
  var stLfo = x.createOscillator(); stLfo.type = 'sine'; stLfo.frequency.value = 0.15;
  var stLfoG = x.createGain(); stLfoG.gain.value = 600;
  stLfo.connect(stLfoG); stLfoG.connect(stFilt.frequency);
  var stGain = x.createGain(); stGain.gain.value = 0.007;
  stSrc.connect(stFilt); stFilt.connect(stFilt2); stFilt2.connect(stGain);
  stGain.connect(mg);
  stSrc.start(); stLfo.start();
  natNodes.push(stSrc, stLfo);
  */

  // ── BIRDS: random chirps scheduled over time ──
  scheduleBirds();
}

var birdTimers = [];
function scheduleBirds() {

  // Bird type 1: Quick two-tone chirp (sparrow-like)
  function chirpA() {
    if (!on || !x) return;
    var t = x.currentTime;
    var base = 3000 + Math.random() * 1500;
    var pairs = 1 + Math.floor(Math.random() * 3);
    for (var p = 0; p < pairs; p++) {
      var pt = t + p * (0.15 + Math.random() * 0.1);
      // High note
      var o1 = x.createOscillator(); o1.type = 'sine';
      o1.frequency.setValueAtTime(base * (1.1 + Math.random() * 0.2), pt);
      o1.frequency.exponentialRampToValueAtTime(base, pt + 0.04);
      var g1 = x.createGain();
      g1.gain.setValueAtTime(0.006, pt);
      g1.gain.exponentialRampToValueAtTime(0.001, pt + 0.05);
      o1.connect(g1); g1.connect(mg); g1.connect(rvG);
      o1.start(pt); o1.stop(pt + 0.07);
      // Low note
      var o2 = x.createOscillator(); o2.type = 'sine';
      o2.frequency.setValueAtTime(base * 0.85, pt + 0.05);
      o2.frequency.exponentialRampToValueAtTime(base * 0.7, pt + 0.09);
      var g2 = x.createGain();
      g2.gain.setValueAtTime(0.005, pt + 0.05);
      g2.gain.exponentialRampToValueAtTime(0.001, pt + 0.1);
      o2.connect(g2); g2.connect(mg); g2.connect(rvG);
      o2.start(pt + 0.05); o2.stop(pt + 0.12);
    }
    birdTimers.push(setTimeout(chirpA, 6000 + Math.random() * 18000));
  }

  // Bird type 2: Higher sparrow variant
  function chirpB() {
    if (!on || !x) return;
    var t = x.currentTime;
    var base = 4000 + Math.random() * 1500;
    var pairs = 2 + Math.floor(Math.random() * 2);
    for (var p = 0; p < pairs; p++) {
      var pt = t + p * (0.12 + Math.random() * 0.08);
      var o1 = x.createOscillator(); o1.type = 'sine';
      o1.frequency.setValueAtTime(base * (1.15 + Math.random() * 0.15), pt);
      o1.frequency.exponentialRampToValueAtTime(base * 0.95, pt + 0.035);
      var g1 = x.createGain();
      g1.gain.setValueAtTime(0.005, pt);
      g1.gain.exponentialRampToValueAtTime(0.001, pt + 0.045);
      o1.connect(g1); g1.connect(mg); g1.connect(rvG);
      o1.start(pt); o1.stop(pt + 0.06);
      var o2 = x.createOscillator(); o2.type = 'sine';
      o2.frequency.setValueAtTime(base * 0.9, pt + 0.04);
      o2.frequency.exponentialRampToValueAtTime(base * 0.75, pt + 0.08);
      var g2 = x.createGain();
      g2.gain.setValueAtTime(0.004, pt + 0.04);
      g2.gain.exponentialRampToValueAtTime(0.001, pt + 0.09);
      o2.connect(g2); g2.connect(mg); g2.connect(rvG);
      o2.start(pt + 0.04); o2.stop(pt + 0.11);
    }
    birdTimers.push(setTimeout(chirpB, 7000 + Math.random() * 20000));
  }

  // Bird type 3: Single long whistle (robin-like)
  function chirpC() {
    if (!on || !x) return;
    var t = x.currentTime;
    var base = 1800 + Math.random() * 800;
    var o = x.createOscillator(); o.type = 'sine';
    // Slow pitch rise then fall
    o.frequency.setValueAtTime(base, t);
    o.frequency.linearRampToValueAtTime(base * 1.3, t + 0.15);
    o.frequency.linearRampToValueAtTime(base * 0.9, t + 0.35);
    var g = x.createGain();
    g.gain.setValueAtTime(0, t);
    g.gain.linearRampToValueAtTime(0.006, t + 0.03);
    g.gain.setValueAtTime(0.005, t + 0.25);
    g.gain.exponentialRampToValueAtTime(0.001, t + 0.4);
    o.connect(g); g.connect(mg); g.connect(rvG);
    o.start(t); o.stop(t + 0.45);
    birdTimers.push(setTimeout(chirpC, 10000 + Math.random() * 25000));
  }

  // Bird type 4: Distant soft sparrow (lower, fewer notes)
  function chirpD() {
    if (!on || !x) return;
    var t = x.currentTime;
    var base = 2400 + Math.random() * 800;
    var o1 = x.createOscillator(); o1.type = 'sine';
    o1.frequency.setValueAtTime(base * 1.1, t);
    o1.frequency.exponentialRampToValueAtTime(base, t + 0.05);
    var g1 = x.createGain();
    g1.gain.setValueAtTime(0.004, t);
    g1.gain.exponentialRampToValueAtTime(0.001, t + 0.06);
    o1.connect(g1); g1.connect(mg); g1.connect(rvG);
    o1.start(t); o1.stop(t + 0.08);
    // Second note after a small gap
    var gap = 0.1 + Math.random() * 0.05;
    var o2 = x.createOscillator(); o2.type = 'sine';
    o2.frequency.setValueAtTime(base * 0.8, t + gap);
    o2.frequency.exponentialRampToValueAtTime(base * 0.65, t + gap + 0.06);
    var g2 = x.createGain();
    g2.gain.setValueAtTime(0.003, t + gap);
    g2.gain.exponentialRampToValueAtTime(0.001, t + gap + 0.07);
    o2.connect(g2); g2.connect(mg); g2.connect(rvG);
    o2.start(t + gap); o2.stop(t + gap + 0.09);
    birdTimers.push(setTimeout(chirpD, 8000 + Math.random() * 25000));
  }

  // Stagger the initial calls randomly
  birdTimers.push(setTimeout(chirpA, 2000 + Math.random() * 5000));
  birdTimers.push(setTimeout(chirpB, 4000 + Math.random() * 8000));
  birdTimers.push(setTimeout(chirpC, 6000 + Math.random() * 10000));
  birdTimers.push(setTimeout(chirpD, 3000 + Math.random() * 6000));
}

function stopNature() {
  for (var i = 0; i < natNodes.length; i++) {
    try { natNodes[i].stop(); } catch(e) {}
  }
  natNodes = [];
  for (var bi = 0; bi < birdTimers.length; bi++) clearTimeout(birdTimers[bi]); birdTimers = [];
}

// ═══════════════════════════════════════════════
// SCHEDULE ONE FULL 24-BAR LOOP
// ═══════════════════════════════════════════════
function sched(t0) {
  for (var ci = 0; ci < 12; ci++) {
    var ch = PROG[ci];
    var cs = t0 + ci * BAR * 2;  // each chord = 2 bars
    var phase = ci < 4 ? 0 : (ci < 8 ? 1 : 2);

    // ── STRINGS (all phases) ──
    // Volume increases with phase
    var sv = phase === 0 ? 0.065 : (phase === 1 ? 0.08 : 0.10);
    for (var n = 0; n < ch.ch.length; n++) {
      str(ch.ch[n], cs, BAR * 2, sv);
    }

    // Phase 3: add upper octave string layer for fullness
    if (phase === 2) {
      for (var n = 0; n < ch.ch.length; n++) {
        if (ch.ch[n] > 100) {
          str(ch.ch[n] * 2, cs, BAR * 2, 0.04);
        }
      }
    }

    /* ── DRUMS (commented out) ──
    for (var bar = 0; bar < 2; bar++) {
      var bt = cs + bar * BAR;
      if (phase === 0) {
        ki(bt, false);
      } else if (phase === 1) {
        ki(bt, false);
        ki(bt + BEAT * 2, false);
        for (var h = 0; h < 4; h++) ht(bt + h * BEAT, false);
      } else {
        ki(bt, true);
        ki(bt + BEAT * 2, true);
        for (var h = 0; h < 8; h++) ht(bt + h * E8, h === 3 || h === 7);
        sn(bt + BEAT);
        sn(bt + BEAT * 3);
      }
    }
    */

    /* ── SCALES (commented out) ──
    var sc = SC[ch.nm];
    if (sc && phase >= 1) {
      var scVol = phase === 1 ? 0.02 : 0.03;
      for (var bar = 0; bar < 2; bar++) {
        var bt = cs + bar * BAR;
        for (var si2 = 0; si2 < 16; si2++) {
          var nv = scVol;
          if (si2 === 0 || si2 === 4) nv += 0.005;
          scN(sc[si2], bt + si2 * S16, nv);
        }
      }
    }
    */
  }
}

// ─── LOOP SCHEDULER ───
function run() {
  nlt = x.currentTime + 0.2;
  function lp() { while (nlt < x.currentTime + 8) { sched(nlt); nlt += LOOP; } }
  lp(); si = setInterval(lp, 3000);
}
function stp() { if (si) { clearInterval(si); si = null; } }

function fi() {
  var t = x.currentTime;
  mg.gain.cancelScheduledValues(t);
  mg.gain.setValueAtTime(mg.gain.value, t);
  mg.gain.linearRampToValueAtTime(0.30, t + 4);  // slow fade in
}
function fo(cb) {
  var t = x.currentTime;
  mg.gain.cancelScheduledValues(t);
  mg.gain.setValueAtTime(mg.gain.value, t);
  mg.gain.linearRampToValueAtTime(0, t + 2.5);  // gentle fade out
  if (cb) setTimeout(cb, 2800);
}

function toggle() {
  ai();
  if (!on) {
    if (x.state === 'suspended') x.resume();
    if (!si) { run(); startNature(); }
    fi(); on = true;
    tg.classList.add('playing');
    
  } else {
    // Capture current bar heights, freeze them, then transition down
    var bars = tg.querySelectorAll('.tvf-bar');
    for (var b = 0; b < bars.length; b++) {
      var h = bars[b].getBoundingClientRect().height;
      bars[b].style.height = h + 'px';
    }
    tg.classList.remove('playing');
    tg.classList.add('stopping');
    // Force reflow so inline heights are applied before transition
    void tg.offsetHeight;
    // Now clear inline heights — CSS .stopping will transition to 2.5px
    for (var b = 0; b < bars.length; b++) {
      bars[b].style.height = '';
    }
    setTimeout(function() {
      tg.classList.remove('stopping');
    }, 700);
    fo(function() { stopNature(); x.suspend(); });
    on = false;
    
  }
  ck();
}

function setup() {
  tg = document.getElementById('tvf-sound-toggle');
  if (!tg) {
    tg = document.createElement('div'); tg.id = 'tvf-sound-toggle'; tg.title = 'Toggle sound';
    tg.innerHTML = '<div class="tvf-diamond"></div><div class="tvf-bars-wrap"><div class="tvf-bar" style="height:2.5px"></div><div class="tvf-bar" style="height:2.5px"></div><div class="tvf-bar" style="height:2.5px"></div><div class="tvf-bar" style="height:2.5px"></div></div>';
    document.body.appendChild(tg);
  }
  tg.addEventListener('click', toggle);

  // Pre-warm audio on first interaction
  var _w = false;
  function _wm() { if (!_w) { _w = true; ai(); if (x && x.state === 'suspended') x.resume(); } }
  document.addEventListener('mousedown', _wm, {passive:true, once:true});
  document.addEventListener('touchstart', _wm, {passive:true, once:true});

  function _hc(e) {
    var el = e.target.closest('a,button,[role="button"],input[type="submit"],.sqs-block-button-element,summary');
    if (el && !el.closest('#tvf-sound-toggle')) { ck(); }
  }
  document.addEventListener('mousedown', _hc, {passive:true});
  document.addEventListener('touchstart', _hc, {passive:true});
}
if (document.readyState === 'loading') document.addEventListener('DOMContentLoaded', setup);
else setup();


// ═══ PAGE LEAVE: quick fade out ═══
function quickFade() {
  if (mg && x && on) {
    var t = x.currentTime;
    mg.gain.cancelScheduledValues(t);
    mg.gain.setValueAtTime(mg.gain.value, t);
    mg.gain.linearRampToValueAtTime(0, t + 0.3);
  }
}
window.addEventListener('beforeunload', quickFade);
document.addEventListener('visibilitychange', function() {
  if (document.hidden) quickFade();
  else if (on && mg && x) {
    if (x.state === 'suspended') x.resume();
    var t = x.currentTime;
    mg.gain.cancelScheduledValues(t);
    mg.gain.setValueAtTime(mg.gain.value, t);
    mg.gain.linearRampToValueAtTime(0.30, t + 1);
  }
});

  // ═══ AUDIO PROMPT: follows cursor, fades on first click ═══
  var prompt = document.getElementById('tvf-audio-prompt');
  if (prompt) {
    var hasFine = window.matchMedia('(hover: hover) and (pointer: fine)').matches;
    if (hasFine) {
      document.addEventListener('mousemove', function(e) {
        if (prompt && !prompt.classList.contains('hidden')) {
          prompt.style.left = e.clientX + 'px';
          prompt.style.top = e.clientY + 'px';
        }
      }, {passive: true});
    }
    // Fade away on any click
    function dismissPrompt() {
      if (prompt) { prompt.classList.add('hidden'); }
      setTimeout(function() { if (prompt && prompt.parentNode) prompt.parentNode.removeChild(prompt); prompt = null; }, 1000);
      document.removeEventListener('mousedown', dismissPrompt);
      document.removeEventListener('touchstart', dismissPrompt);
    }
    document.addEventListener('mousedown', dismissPrompt, {passive: true, once: true});
    document.addEventListener('touchstart', dismissPrompt, {passive: true, once: true});
  }

})();
